Mongoose: How do I pass data from a document created afterwards into a document created right before?<p>In my signup request, I use create two documents (in separate collections) based on two different schemas: a User model and a Client model. For context, a client will be one object referencing an array of many Users.</p>
<p>The User scheme includes 'clientID' field, which should hold the User's Client's ._id. Likewise, the Client's 'users' field would include an array of Users attached. The latter works OK.</p>
<p>On signup, I create a User, and then a Client. I am able to pass the User._id into the Client's array of users no problem. But, how do I get the Client's ._id into the User's clientID field?</p>
<p>The code below errors saying: Cannot access 'client' before initialization - I understand why this is happening because of the order of code.</p>
<p>But how do I get my code to reciprocate so that I can add the Client._id to the User's clientID field? I am sure this is a common problem, but I can't find the relevant doc on Mongoose's docs.</p>
<p>If anyone could help? Many thanks!</p>
<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>module.exports.signup = async (req, res) =&gt; {

  // extract data from the req.body
  const { email, password, fName, lName, companyName, teams } = req.body;

  try {
    // create a new user on the User model
    const user = await User.create({
      email: email,
      password: password,
      clientID: client._id,
    });

    // create a new client on the Client model
    const client = await Client.create({
      companyName: companyName,
      users: user._id,
    });

    res.status(201).json(user);
  } catch (err) {
    const errors = handleErrors(err);
    res.status(400).json(errors);
  }
};</code></pre>
</div>
</div>
</p>

