Mongoose Validations/Hooks based on most recent record in table (if exists) | Model for a Bank Account<p>I am designing a bank account schema, which looks like follows:</p>
<pre><code>const bankAccountSchema = new mongoose.Schema({
    transactionType: {
        type: String,
        enum: ['credit', 'debit']
        required: true
    },
    amount: {
        type: Number,
        required: true
    },
    balance: {
        type: Number,
        min: 0,
        required: true
    }
}, {
    timestamps: true
})

const BankAccount = mongoose.model('BankAccount', bankAccountSchema)
</code></pre>
<p>As far as the user is concerned, they can only add or remove <code>amount</code> (positive or negative) from the account. The <code>balance</code> column is supposed to keep track of the running total in the account. In the route, I already have code that prevents the user from withdrawing more money than he has in the account but I am wondering if it is possible to set up the following validations/hooks for my model as well:</p>
<ol>
<li>Before saving, automatically update the <code>balance</code> and <code>transactionType</code> (<code>credit</code> if <code>amount</code> is positive, <code>debit</code> if <code>amount</code> is negative) columns based on <code>amount</code> and previous record's <code>balance</code> (if exists) so that records can be created simply by the command <code>new BankAccount({ amount: 100 }).save()</code> without explicitly stating appropriate <code>balance</code> or <code>transactionType</code>.</li>
<li>Should be unable to withdraw more than is available in account i.e. if the previous record's <code>balance</code> is 100 then <code>amount</code> for a new record can never be less than -100.</li>
</ol>
<p>Both (1) and (2) require accessing the previous record in the table (if exists) before save. Can this be done or do I have to depend solely on my route for validation?</p>

